package ramling;

public class GFG5 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int x[][]= {{1,2,3},{4,5,6}};
		for(int i=0;i<x.length;i++)
		{
			for(int j=0;j<=x.length;j++)
			{
				System.out.print(x[i][j]+" ");
			}
			System.out.println();
		}
		

	}

}
